$_MODULE['<{ets_contactform7}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Formularze kontaktowe';
$_MODULE['<{ets_contactform7}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Aby dodać pole wejściowe reCAPTCHA, musisz najpierw włączyć reCAPTCHA. Przejdź do [1]„Ustawienia > Integracja > reCAPTCHA”[/1], włącz opcję reCAPTCHA i wprowadź parę kluczy.';
$_MODULE['<{ets_contactform7}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Aby dowiedzieć się, jak uzyskać klucz strony reCAPTCHA i klucz tajny, zapoznaj się z naszą dokumentacją modułu';
$_MODULE['<{ets_contactform7}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Aby móc odpowiadać na wiadomości klientów bezpośrednio na zapleczu, potrzebujesz swojego adresu e-mail klienta. Tworząc formularz kontaktowy, upewnij się, że dodałeś pole wejściowe e-mail i oznacz je jako pole wymagane.';
$_MODULE['<{ets_contactform7}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Konfiguracje poczty e-mail';
$_MODULE['<{ets_contactform7}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Aby uzyskać informacje z formularza kontaktowego do wiadomości e-mail wysłanej na adres e-mail administratora lub automatycznej odpowiedzi, skopiuj i wklej odpowiednie tagi poczty w polu [1]„Treść wiadomości”[/1] w [1]„Formularze kontaktowe > Poczta„[/1] podkarta';
